local Command = {};
---将游戏场景中已有的UI激活
function Command.Execute(notifyName, ...)
    local view, args = HandleNotifyParams(...);
    local go = args[1]
    local is_click = args[2] or nil
    local callBack = args[3]
    local show = args[4]
    local enableParams = args[5]
    if is_click then
        --事件打点_UI交互_点击打开界面
        SDK.click_view(view.viewName,SceneViewManager.GetCurrentSceneName())
    end
    if not view or type(view)~="table" then
        log.r("view is nil")
        return
    end
    log.y("ShowLoadUI view:",view.viewName )
    --log.r("ShowLoadUI view:",view )
    if not go then
        log.r("没有传入参数：需要显示的UI")
        return
    end
 
    --log.y("ShowUI view:",view.viewName )
    --log.r("ShowUI view:",view )
    SceneViewManager.AddView(view)
    view:SkipLoadShow(go,show,callBack,enableParams);
end
return Command;